import React, {Component} from 'react'
import bank from '../bank.png'

class Navbar extends Component{
    render(){
        return (
<nav className='navbar navbar-dark fixed-top shadow p-0' style={{background:'black',height:'50px'}}>
<a className='navbar-brand col-sm-3 col-md-0 mr-0' style={{color:'yellow'}}>DECENTRALIZED BANK</a>
<img src={bank} width='50' height='30' className='d-inline-block align-top'/>
<ui className='navbar-nav px-3'>
<li className='text-nowrap d-none nav-item d-sm-none d-sm-block'>
<small style={{color:'white'}}>ACCOUNT NUMBERS</small>
</li>
</ui>
</nav>
      )  
    }
}
export default Navbar;
